3rd and 4th Reg #Firsties took one step closer to graduation, taking the Indoor Obstacle Course Test administered by the Department of Physical Education. The IOCT is a test of full-body functional physical fitness and it is considered to be one of the best evaluations of total body #fitness given in the Army.📷: CDT Thomas Hannah. #WestPoint #goarmy 

